import React, { useState } from 'react';
import { Form, Button, Card, Alert } from 'react-bootstrap';
import { jobAPI } from '../services/api';

const JobForm = ({ onJobCreated }) => {
  const [job, setJob] = useState({
    title: '', company: '', description: '', requirements: '', location: '', salary: '', postedBy: ''
  });
  const [message, setMessage] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await jobAPI.create(job);
      setMessage('Job posted successfully!');
      setJob({ title: '', company: '', description: '', requirements: '', location: '', salary: '', postedBy: '' });
      onJobCreated?.();
    } catch (error) {
      setMessage('Error posting job');
    }
  };

  return (
    <Card>
      <Card.Header><h4>Post New Job</h4></Card.Header>
      <Card.Body>
        {message && <Alert variant={message.includes('Error') ? 'danger' : 'success'}>{message}</Alert>}
        <Form onSubmit={handleSubmit}>
          <Form.Group className="mb-3">
            <Form.Label>Job Title</Form.Label>
            <Form.Control value={job.title} onChange={(e) => setJob({...job, title: e.target.value})} required />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Company</Form.Label>
            <Form.Control value={job.company} onChange={(e) => setJob({...job, company: e.target.value})} required />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Description</Form.Label>
            <Form.Control as="textarea" rows={3} value={job.description} onChange={(e) => setJob({...job, description: e.target.value})} required />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Requirements</Form.Label>
            <Form.Control as="textarea" rows={3} value={job.requirements} onChange={(e) => setJob({...job, requirements: e.target.value})} required />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Location</Form.Label>
            <Form.Control value={job.location} onChange={(e) => setJob({...job, location: e.target.value})} required />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Salary</Form.Label>
            <Form.Control value={job.salary} onChange={(e) => setJob({...job, salary: e.target.value})} />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Posted By</Form.Label>
            <Form.Control value={job.postedBy} onChange={(e) => setJob({...job, postedBy: e.target.value})} required />
          </Form.Group>
          <Button type="submit" variant="primary">Post Job</Button>
        </Form>
      </Card.Body>
    </Card>
  );
};

export default JobForm;
